    [],nt"revision_timestamp": "2016-07-27T22:55:30.255230",nt"name": "ecological-integrity-assessment-watershed-analysis-and-habitat-vulnerability-climate-chang",nt"isopen":
    false,nt"url": null,nt"notes": "This report is the second part of a pilot
    study to map the vegetation of Camas National Wildlife Refuge and determine the
    overall ecological integrity of the refuge, how it compares to other wetlands in
    the surrounding watershed, and a look into the degree of vulnerability to climate
    change of key habitat types found on the refuge. The first part yielded a vegetation
    classification, map and database using the Federal Standard National Vegetation
    Classification System (see Miewald et al. 2012). The second part included three
    complementary analyses: 1) Ecological Integrity Assessment of the vegetation resource
    as mapped at Camas National Wildlife Refuge, 2) Watershed analysis of the abundance
    and condition of wetlands across the immediate Beaver-Camas watershed and larger
    surrounding Upper Snake River watershed to determine the relative importance of
    Camas NWR wetlands from a watershed perspective, and 3) Application of the Habitat
    Climate Change Vulnerability Index on four habitat types throughout their range
    of distribution within the Snake River Plain ecoregion that are also found on the
    refuge.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
